		<script type="text/javascript">
			document.domain="beileitu.com";
			function setCookie(name,value){
		        var exp = new Date();
		        exp.setTime(exp.getTime() + 1*1*30*60*1000);
		        document.cookie = name + "="+ escape (value) + ";expires=" + exp.toGMTString();
			}

			function getCookie(name){
		        var arr,reg=new RegExp("(^| )"+name+"=([^;]*)(;|$)");
		        if(arr=document.cookie.match(reg))
		            return unescape(arr[2]);
		        else
		        return null;
			}

			function GetUrlParam() {
		        var url = decodeURI(window.location.href);
		        var thisParam = new Object();
		        // 判断是否存在请求的参数
		        if (url.indexOf('?') != -1) {
		          var str = url.split('?')[1];
		          // 截取所有请求的参数，以数组方式保存
		          var strs = str.split('&');
		          for (var i = 0; i < strs.length; i++) {
		            // 获取该参数名称，值。其中值以unescape()方法解码，有些参数会加密
		            thisParam[strs[i].split('=')[0]] = strs[i].split('=')[1];
		          }
		        }
		        // 返回改参数列表对象
		        return thisParam;
		    }

		    var c_code = GetUrlParam();
		    setCookie('i_code',c_code);
			var data = OpenInstall.parseUrlParams();
// 			if(data.i_code == undefined || data.i_code == ""){
				// data = getCookie('i_code');
// 			}
			new OpenInstall({
    			appKey : "husgo5",
    			onready : function() {
    				var m = this, button = document.getElementById("download");
    				button.style.visibility = "visible";
    				m.schemeWakeup();
    				button.onclick = function() {
        				m.wakeupOrInstall();
        				return false;
    				}
    			}
			}, data);
			
						new OpenInstall({

        				m.wakeupOrInstall();
        				return false;
    				}
    			}
			}, data);
			
		</script>
